import './App.css';
import Intro from './components/Intro/Intro';
import Projects from './components/Projects/Projects';
import Welcome from './components/Welcome/Welcome';
import Contact from './components/Contact/Contact';

function App() {
  return (
    <div className="App">
      <Intro />
      <Welcome />
      <div className="projects-with-side-design">
        <div className="projects-color-left-side-highlight" />
        <Projects />
        <div className="projects-color-left-side-highlight" />
      </div>
      <Contact />
    </div>
  );
}

export default App;
